import React, { Component } from 'react';

export default class Signup extends Component{
    render(){
        return(<div>
            <div>
                <form action="/signup_verify" method="POST">
                    <input type="text" placeholder="First name" maxlength="30" name="first_name" className="form-control"/>
                    <input type="text" placeholder="Last name" maxlength="30" name="last_name" className="form-control"/>
                    <input type="email" placeholder="Email" maxlength="100" name="email" className="form-control"/>
                    <input type="phone" placeholder="Phone" maxlength="10" name="phone" className="form-control"/>
                    <input type="password" placeholder="Password" maxlength="16" name="password" className="form-control"/>
                    <input type="Submit" value="Signup" className="form-control btn btn-primary"/>
                </form>
            </div>
        </div>)}
    }
